export default class Home extends Component {

    constructor(props) {
        super(props);
        this.state = {
            name:'',
            email:''
        }
    }

    componentDidMount() {

    }

    render() {
        return (
            <Jumbotron fluid>
                <Container>
                    <h1 style={{ fontFamily: "monospace" }}>Welcome to JobsPlanet</h1>
                    <p>
                    <h6><i>Easiest way to find your dream job!</i></h6>
                    </p>
                    <Link to="/login">Login</Link>
                    <Link to="/register">Register</Link>
                </Container>
            </Jumbotron>
        )
    }
}
